HQ rare live performance on Late World with Zach that was uploaded by me to youtube. &quot;Comfort Eagle&quot; is a song from  Comfort Eagle, the fourth studio album by American alternative rock band Cake. It was released on July 24, 2001, through record label Columbia; their first with the label.

In its opening week, Comfort Eagle sold about 72,000 copies, debuting at number 13 on the Billboard 200. On February 2, 2003 the album was certified gold by the RIAA for shipments of half a million copies.

Comfort Eagle was generally well-received by critics, with reviewers noting the album's similarity to the band's previous albums, for better or worse.

Cake is an American alternative rock band from Sacramento, California. Consisting of singer John McCrea, trumpeter Vince DiFiore, guitarist Xan McCurdy, bassist Gabe Nelson and drummer Paulo Baldi, the band has been noted for McCrea's sarcastic lyrics and deadpan voice, DiFiore's trumpet parts, and their wide-ranging musical influences, including country music, Mariachi, rock, funk, Iranian folk music and hip-hop.

Cake was formed in 1991 by McCrea, DiFiore, Greg Brown, Frank French and Shon Meckfessel, who soon left and was replaced by Nelson. Following the self-release of its debut album, Motorcade of Generosity, the band was signed to Capricorn Records in 1995 and released its first single, &quot;Rock 'n' Roll Lifestyle&quot;, which hit number 35 on the Modern Rock Tracks music chart and was featured on MTV's 120 Minutes; French and Nelson then left the band, and were replaced by Todd Roper and Victor Damiani. Cake's second album, Fashion Nugget, was released in 1996; on the strength of the lead single, &quot;The Distance&quot;, which went platinum. Following a tour of Europe and the United States, both Brown and Damiani announced they were leaving Cake, which led to speculation about the band's future; McCrea eventually recruited Xan McCurdy to take over on guitar, and persuaded Nelson to return.

After creating its own label, Upbeat Records, the band released Showroom of Compassion in 2011, which became its first album to debut at the top of the Billboard charts, selling 44,000 copies in the first week after release.

They will release a vinyl box set consisting of their six studio albums, their rarities album and the previously unreleased, Live at the Crystal Palace for Record Store Day 2014. A new studio album has been announced for an early 2014 release.
